  root: {
    flexGrow: 1,
    marginTop:'11rem',

  },

  control: {
    padding: theme.spacing(2),
  },
}));
const Hero = ()=>{
  const classes = useStyles();
    return(
      <div className={classes.root}>
      <Grid   
      container
      direction="row"
      justify="center"
      alignItems="center" spacing={2}>
      <Grid item xs={12} lg={5} md={5}>
      <Typography variant="h3" component="h3" gutterBottom >
       Hello There 
      </Typography>
        <Typography variant="h4" gutterBottom>
       <p> I'm Rayan Ramirez, a self-taught JavaScript developer &&  Release Engineer <FcCommandLine size="2rem"/> </p>
      </Typography>
      </Grid>
   </Grid>
   </div>
    )
}

export default Hero
